        <div style={{display: 'flex', justifyContent: 'space-between', alignItems: 'center', backgroundColor: '#6A0DAD', padding: '20px', color: 'white'}}>
            <div>
                <h1>OLA</h1>
            </div>

            <div>
                <h1 style={{color: 'white'}}>Bem vindo, Usuário.</h1>
                <p style={{color: 'white'}}> <b>Saldo: R$ 50,00</b> </p>
            </div>
        </div>
    );
}

export default Home;
